import "./style.css"
import React from "react"
import ReactDOM from "react-dom"
import Home from "./pages/Home"
import Other from "./pages/Other"
import NavigationBar from "./NavigationBar"
import { BrowserRouter, Route, Routes, Navigate } from "react-router-dom";
import { CSSTransition, TransitionGroup } from "react-transition-group";

function Page() {
  return (

      <BrowserRouter>
        <Routes>
          <Route exact path="/" element={<Navigate to="/home" state/>} />

            <Route path="/home" element={
              <div className="page">
                <div className="navbar"><NavigationBar current={"Home"} /></div>
                <div className="app-container"><Home /></div>
              </div>
            } />

            <Route path="/other" element={
              <div className="page">
                <div className="navbar"><NavigationBar current={"Other"} /></div>
                <div className="app-container"><Other /></div>
              </div>
            } />

        </Routes>
      </BrowserRouter>
  );
}

const rootElement = document.getElementById("root")
ReactDOM.render(<Page />, rootElement)
